Vue.component('axis-chart-demo', {
  template: '\n<div class = \'axis-chart-demo demo container\'>\n  <demo-button name = \'Axis Chart\' v-model = \'started\'></demo-button>\n  <div class = \'demo-chart\'>\n    <axis-chart :data = \'data\'></axis-chart>\n  </div>\n</div>\n  ',
  components: {
    'axis-chart': d2b.vueChartAxis
  },
  data: function data() {
    var graphA = { label: 'Graph A', values: this.randomValues(1) },
        graphB = { label: 'Graph B', values: this.randomValues(2) },
        graphC = { label: 'Graph C', values: this.randomValues(3) },
        graphs = [graphA, graphB, graphC];

    var line = d2b.svgLine(),
        area = d2b.svgArea();

    line.line().curve(d3.curveBasis);
    area.area().curve(d3.curveBasis);

    return {
      started: false,
      interval: null,
      graphs: graphs,
      data: {
        sets: [{
          generators: [area, line],
          graphs: graphs
        }]
      }
    };
  },
  watch: {
    started: function started() {
      var _this = this;

      if (this.started) {
        this.interval = setInterval(function () {
          _this.graphs.forEach(function (graph, i) {
            graph.values = _this.randomValues(i + 1);
          });
        }, 2000);
      } else {
        clearInterval(this.interval);
      }
    }
  },
  methods: {
    randomValues: function randomValues(mult) {
      var data = [];
      for (var i = 0; i < 30; i++) {
        data.push({
          x: i,
          y: Math.round(Math.random() * 20 * mult)
        });
      };
      return data;
    }
  }
});
'use strict';

Vue.component('demo-button', {
  props: {
    value: {
      'default': false
    },
    name: {
      'default': ''
    }
  },
  template: '\n<div class = \'demo-button\' @click = \'toggle\'>\n  <div class = \'demo-message\'>{{ name }}</div>\n  <div class = \'demo-toggle\'>{{ message }}</div>\n</div>\n  ',
  computed: {
    message: function message() {
      return this.value ? 'Stop Demo' : 'Start Demo';
    }
  },
  methods: {
    toggle: function toggle() {
      this.$emit('input', !this.value);
    }
  }
});
